import "./menu.css";

const Menu = () => {
  const menu = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  console.log(menu);
  return (
    <nav className="navbar width-50">
      <div className="nav-item fs-6">Stay</div>
      <div className="nav-item fs-6">Flight</div>
      <div className="nav-item fs-6">Car Rentals</div>
      <div className="nav-item fs-6">Attractions</div>
      <div className="nav-item fs-6">Airport taxis</div>
    </nav>
  );
};

export default Menu;
